        private async void check_plant(string plant)
        {
            HttpResponseMessage response = null;

            response = await _client.GetAsync(API.BASE_URL + "plant/" + plant);

            var result = await response.Content.ReadAsStringAsync();

            var p = JsonConvert.DeserializeObject<List<PlantaObj>>(result);

            if (p.Count > 0)
            {
                await Navigation.PushModalAsync(new PesquisaDetalhe(p[0]));
                erro.Text = "";
            }
            else
            {
                nome_c.Text = plant;
                
            }
        }
       
